import { Fragment } from "react";
import React from "react";

class About extends React.Component {
  render() {
    return (
      <Fragment>
        <img
          src="https://via.placeholder.com/300"
          class="img-thumbnail rounded mx-auto d-block"
          alt="About"
        ></img>
        <hr />
      </Fragment>
    );
  }
}

export default About;
